from collections import defaultdict

def count_squares(N, M, hh, ww):
    if N == 0 and M == 0:
        return 0
    cnts = defaultdict(int)
    rhh = hh[:]
    for i in range(1, N):
        rhh[i] += rhh[i - 1]
    rhh.append(0)
    for i in range(N + 1):
        for j in range(i + 1, N + 1):
            tmp = rhh[j - 1] - rhh[i - 1]
            cnts[tmp] += 1
    rww = ww[:]
    for i in range(1, M):
        rww[i] += rww[i - 1]
    rww.append(0)
    ans = 0
    for i in range(M + 1):
        for j in range(i + 1, M + 1):
            tmp = rww[j - 1] - rww[i - 1]
            ans += cnts[tmp]
    return ans

